import { jsPDF } from "jspdf"
var Regular = '';

var Bold = '';

var Italic = '';

var BoldItalic = '';

var callAddFont = function () {
this.addFileToVFS('AngsanaNew-Regular.ttf', Regular);
this.addFileToVFS('AngsanaNew-Bold.ttf', Bold);
this.addFileToVFS('AngsanaNew-Italic.ttf', Italic);
this.addFileToVFS('AngsanaNew-BoldItalic.ttf', BoldItalic);

this.addFont('AngsanaNew-Regular.ttf', 'AngsanaNew', 'normal');
this.addFont('AngsanaNew-Bold.ttf', 'AngsanaNew', 'bold');
this.addFont('AngsanaNew-Italic.ttf', 'AngsanaNew', 'italic');
this.addFont('AngsanaNew-BoldItalic.ttf', 'AngsanaNew', 'bolditalic');
};
jsPDF.API.events.push(['addFonts', callAddFont])
